import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { User, Mail, Lock, ArrowRight } from 'lucide-react';

const StudentSignUp = ({ onLogin }) => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    confirmPassword: ''
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');

    // 1. Basic Validation
    if (formData.password !== formData.confirmPassword) {
      setError("Passwords do not match");
      return;
    }
    if (!formData.name || !formData.email || !formData.password) {
      setError("All fields are required");
      return;
    }

    // 2. Get existing users from Local Storage
    const existingUsers = JSON.parse(localStorage.getItem('users') || '[]');

    // 3. Check if email already exists
    if (existingUsers.find(user => user.email === formData.email)) {
      setError("User with this email already exists");
      return;
    }

    // 4. Create new user object
    const newUser = {
      name: formData.name,
      email: formData.email,
      password: formData.password, // In a real app, never store plain text passwords!
      role: 'student',
      profileImage: "https://images.unsplash.com/photo-1535713875002-d1d0cf377fde?w=200&q=80"
    };

    // 5. Save to Local Storage
    existingUsers.push(newUser);
    localStorage.setItem('users', JSON.stringify(existingUsers));

    // 6. Log the user in automatically
    onLogin(newUser);
    navigate('/');
  };

  return (
    <div style={{
      minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center',
      backgroundColor: '#f8fafc', padding: '20px'
    }}>
      <div style={{
        backgroundColor: '#fff', padding: '40px', borderRadius: '20px',
        boxShadow: '0 10px 25px rgba(0,0,0,0.05)', width: '100%', maxWidth: '400px'
      }}>
        <h2 style={{fontSize:'24px', fontWeight:'bold', marginBottom:'10px', color:'#1e293b'}}>Create Account</h2>
        <p style={{color:'#64748b', marginBottom:'30px'}}>Join EventSphere as a Student</p>

        {error && <p style={{color: 'red', fontSize: '14px', marginBottom: '15px'}}>{error}</p>}

        <form onSubmit={handleSubmit} style={{display:'flex', flexDirection:'column', gap:'20px'}}>

          <div style={{position:'relative'}}>
            <User size={20} color="#94a3b8" style={{position:'absolute', left:'15px', top:'50%', transform:'translateY(-50%)'}}/>
            <input 
              type="text" name="name" placeholder="Full Name" value={formData.name} onChange={handleChange}
              style={{width:'100%', padding:'12px 12px 12px 45px', borderRadius:'10px', border:'1px solid #e2e8f0', outline:'none'}}
            />
          </div>

          <div style={{position:'relative'}}>
            <Mail size={20} color="#94a3b8" style={{position:'absolute', left:'15px', top:'50%', transform:'translateY(-50%)'}}/>
            <input 
              type="email" name="email" placeholder="Email Address" value={formData.email} onChange={handleChange}
              style={{width:'100%', padding:'12px 12px 12px 45px', borderRadius:'10px', border:'1px solid #e2e8f0', outline:'none'}}
            />
          </div>

          <div style={{position:'relative'}}>
            <Lock size={20} color="#94a3b8" style={{position:'absolute', left:'15px', top:'50%', transform:'translateY(-50%)'}}/>
            <input 
              type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange}
              style={{width:'100%', padding:'12px 12px 12px 45px', borderRadius:'10px', border:'1px solid #e2e8f0', outline:'none'}}
            />
          </div>

          <div style={{position:'relative'}}>
            <Lock size={20} color="#94a3b8" style={{position:'absolute', left:'15px', top:'50%', transform:'translateY(-50%)'}}/>
            <input 
              type="password" name="confirmPassword" placeholder="Confirm Password" value={formData.confirmPassword} onChange={handleChange}
              style={{width:'100%', padding:'12px 12px 12px 45px', borderRadius:'10px', border:'1px solid #e2e8f0', outline:'none'}}
            />
          </div>

          <button type="submit" style={{
            backgroundColor:'#4f46e5', color:'#fff', padding:'12px', borderRadius:'10px', 
            border:'none', fontWeight:'bold', cursor:'pointer', display:'flex', alignItems:'center', justifyContent:'center', gap:'10px'
          }}>
            Sign Up <ArrowRight size={18} />
          </button>
        </form>

        <p style={{marginTop:'20px', textAlign:'center', color:'#64748b', fontSize:'14px'}}>
          Already have an account? <span onClick={() => navigate('/signin')} style={{color:'#4f46e5', fontWeight:'bold', cursor:'pointer'}}>Sign In</span>
        </p>
        <p style={{marginTop:'10px', textAlign:'center', color:'#64748b', fontSize:'14px'}}>
          Are you a teacher? <span onClick={() => navigate('/teacher-signup')} style={{color:'#4f46e5', fontWeight:'bold', cursor:'pointer'}}>Register here</span>
        </p>
      </div>
    </div>
  );
};

export default StudentSignUp;
